const { request } = require('@octokit/request')
const requestWithAuth = request.defaults({
    headers: {
        authorization: process.env.GITHUB_TOKEN,
    },
})
const fetch = require('node-fetch')
const { URL } = process.env
const onboard =
    'data:image/png;base64,'

exports.handler = async (event, context) => {
    if (event.httpMethod !== 'POST') {
        return {
            statusCode: 405,
            headers: {
                'Content-Type': 'text/plain',
            },
            body: 'Method Not Allowed',
        }
    }

    let req_body
    try {
        req_body = JSON.parse(event.body)
    } catch {
        return {
            statusCode: 400,
            headers: {
                'Content-Type': 'text/plain',
            },
            body: 'Bad Request',
        }
    }

    let device_id = req_body.id
    let pub_key = req_body.pk
    if (device_id == null || pub_key == null) {
        return {
            statusCode: 400,
            headers: {
                'Content-Type': 'text/plain',
            },
            body: 'Bad Request',
        }
    }

    return requestWithAuth('PUT /repos/{owner}/{repo}/contents/{path}', {
        owner: process.env.REPO_OWNER,
        repo: process.env.REPO_NAME,
        path: `${device_id}/public.crt`,
        message: `Adding public key for ${device_id}.`,
        content: pub_key,
    })
        .then((response) => response.data)
        .then((data) =>
            onboardDevice(device_id)
                .then((resp) => resp)
                .catch((error) =>
                    cleanup(device_id, data.content.sha)
                        .then((resp) => ({
                            statusCode: 400,
                            headers: {
                                'Content-Type': 'text/plain',
                            },
                            body: 'Could not onboard device. Unregistered.',
                        }))
                        .catch((error) => ({
                            statusCode: 500,
                            headers: {
                                'Content-Type': 'text/plain',
                            },
                            body:
                                'Could not onboard device. Could not unregister.',
                        }))
                )
        )
        .catch((error) => ({
            statusCode: 409,
            headers: {
                'Content-Type': 'text/plain',
            },
            body: `Unable to register device.`,
        }))
}

function onboardDevice(device_id) {
    return fetch(`${URL}/.netlify/functions/upload`, {
        method: 'POST',
        body: JSON.stringify({
            id: device_id,
            data: onboard,
        }),
        headers: { 'Content-Type': 'application/json' },
    }).then((res) => {
        if (res.ok) {
            return {
                statusCode: 200,
                headers: {
                    'Content-Type': 'text/plain',
                },
                body: 'Successfully registered device.',
            }
        }
        throw new Error(res.statusText)
    })
}

function cleanup(device_id, pk_sha) {
    return requestWithAuth('DELETE /repos/{owner}/{repo}/contents/{path}', {
        owner: process.env.REPO_OWNER,
        repo: process.env.REPO_NAME,
        path: `${device_id}/public.crt`,
        message: `Unregistering ${device_id}.`,
        sha: pk_sha,
    }).then((response) => ({
        statusCode: 200,
        headers: {
            'Content-Type': 'text/plain',
        },
        body: 'Unregistered.',
    }))
}
